// MediaCenter.js
import React from 'react';
import './MediaCenter.css';
import p1 from 'efficiency_web_app\src\assets\media\q1.jpg';
import p2 from '../src/assets\media\q2.jpg';
import p3 from '../src/assets/media/q3.jpg';
import p4 from '../src/assets/media/q4.jpg';
import p5 from '../assets/media/q5.jpg';
import p6 from '../assets/media/q6.jpg';


function MediaCenter() {
  return (
    <div className="media-center">
      <h1>Media Center</h1>
      <div className="gallery">
        <div className="item">
          <img src={p1} />
          <p>Description for Photo 1</p>
        </div>
        <div className="item">
          <img src={p2} />
          <p>Description for Photo 2</p>
        </div>
        <div className="item">
          <img src={p3} />
          <p>Description for Photo 3</p>
        </div>
        <div className="item">
          <img src={p4} />
          <p>Description for Photo 4</p>
        </div>
        <div className="item">
          <img src={p5} />
          <p>Description for Photo 5</p>
        </div>
        <div className="item">
          <img src={p6}/>
          <p>Description for Photo 6</p>
        </div>
      </div>
    </div>
  );
}

export default MediaCenter;
